import {Link} from "react-router-dom";

const Login = () => {

    return (
        <>
       
            
            <div className="card p-3  fb-shadow">
                <input type="email" className="form-control m-3" value="" placeholder="enter email" />
                <input type="password" className="form-control" placeholder="password"/>
                <button type="button" className="btn btn-primary btn-block mt-3 mb-2">Login</button>
                <Link to="forget-password" className="text-primary m-3 text-center">Forget Password</Link>
                <hr/>
                <button type="button" className="btn btn-success btn-block">Create Account</button>
            </div>
        </>
    )
}

export default Login;
